Results and Discussion

Crystal Structure of {P2W18}

The results of bond valence sum calculations of tungstens of {P2W18} in compound 1 give the average value 6.11, confirming that the tungstens are in the +6 oxidation state. The tungstens can be divided into two types: six "polar" ones, grouped into two sets of three, and 12 "equatorial" ones, grouped into two sets of six. Accordingly, surface oxygens can be grouped into two kinds: polar and equatorial ones.

